(17, 3, 'Auftrag Illustrationen', '', 1, ' Erstellen Sie mit Hilfe des Bildes novemer.jpg in Excel eine Illustration, die wie nachfolgend aussieht. Beachten Sie die ausgeblendeten Gitternetzlinien.<br /><img src=\"data:image/png;base64,\" /><br /> ', 1, 2, NULL, 5, 'a:1:{s:10:\"printintro\";i:0;}', 1, 1351667450);
INSERT INTO `mdl_page` (`id`, `course`, `name`, `intro`, `introformat`, `content`, `contentformat`, `legacyfiles`, `legacyfileslast`, `display`, `displayoptions`, `revision`, `timemodified`) VALUES
(18, 3, 'Prüfungsstoff 3. Prüfung', '', 1, '<div class=\"box generalbox generalboxcontent boxaligncenter clearfix\"> \n  <div class=\"box generalbox generalboxcontent boxaligncenter clearfix\"> \n    <div class=\"box generalbox generalboxcontent boxaligncenter clearfix\"> \n      <p><strong>Prüfungsstoff:</strong></p> \n      <ul> \n        <li>Lehrmittel Kapitel 13 - 21 (S. 108 - 187) </li> \n      </ul> \n      <p><strong>Lernziele:</strong></p> \n      <ul> \n        <li>Sie können Formatierungen in Excel anwenden.</li> \n        <li>Sie kennen die Druckmöglichkeiten von Excel und können Kopf- und Fusszeilen einrichten.</li> \n        <li>Sie können Formatvorlagen und Mustervorlagen erstellen und kennen die Vorteile davon.</li> \n        <li>Sie kennen die Automatisierungshilfen von Excel und können diese erweitern.</li> \n        <li>Sie kennen die wichtigsten Zahlenformate und können Zellen entsprechend formatieren.</li> \n        <li>Sie können Illustrationen in Excel einfügen und formatieren.</li> \n        <li>Sie können relative, absolute und gemischte Bezüge verwenden.</li> \n        <li>Sie können Spalten und Zeilen einfügen, löschen, ein- und ausblenden.</li> \n        <li>Sie können mit einfachen Funktionen Berechnungen in Excel ausführen.</li> \n        <li>Sie können in Excel mit Datum und Uhrzeit Berechnungen ausführen.<br /></li> \n      </ul> \n      <p><strong>Hilfsmittel:</strong></p> \n      <ul> \n        <li>Lehrmittel</li> \n      </ul></div> </div> </div> ', 1, 2, NULL, 5, 'a:1:{s:10:\"printintro\";i:0;}', 1, 1352281485),
(19, 3, '3. Prüfung', '', 1, '3. Prüfung ', 1, 2, NULL, 5, 'a:1:{s:10:\"printintro\";i:0;}', 1, 1353308638),
(20, 3, 'Individuelles Arbeiten an Browser-Präsentationen', '', 1, 'Individuelles Arbeiten an Browser-Präsentationen ', 1, 2, NULL, 5, 'a:1:{s:10:\"printintro\";i:0;}', 1, 1354084582),
